import React, { Component } from "react";
import Button from "@material-ui/core/Button";
import { Link } from "react-router-dom";

class SubmitGoalButton extends Component {
  state = {};
  render() {
    return (
      <div style={{ width: "100%" }}>
        <Button
          className="goal-category-button"
          component={Link}
          to="/goals/health"
          size="small"
          variant="contained"
          color="primary"
          style={{ width: "auto", marginLeft: "45%" }}
        >
          {"Submit"}
        </Button>
        <Button
          className="goal-category-button"
          component={Link}
          to="/goals/health"
          size="small"
          variant="contained"
          color="primary"
          style={{ width: "50px", marginLeft: "45%", paddingTop: "1em" }}
        >
          {"Submit & Add Goal "}
        </Button>
      </div>
    );
  }
}

export default SubmitGoalButton;
